class Solution {
    public List<Integer> unique(List<Integer> l) {
        Collections.sort(l);
        List<Integer> uniqueElements = new ArrayList<>();
        for (int i = 0; i < l.size(); i++) {
            if (i == 0 || l.get(i) != l.get(i - 1)) {
                uniqueElements.add(l.get(i));
            }
        }
        return uniqueElements;
    }
}

