        List<Integer> results = new ArrayList<>();
        results.add(0);
        results.add(0);
        results.add(2);
        results.add(0);
        if (n < 4) {
            return results.get(n);
        }

        for (int i = 4; i <= n; i++) {
            results.add(results.get(1) + results.get(2) + results.get(3));
            results.remove(0);
        }
        return results.get(2);
    }
}

