class Solution {
    public int fib4(int n) {
        if (n <= 3) {
            return 0;
        }

        int a = 0, b = 0, c = 2, d = 0;
        for (int i = 4; i <= n; i++) {
            a = b;
            b = c;
            c = d;
            d = a + b + c + d;
        }
        return d;
    }
}

