    public int maxFill(List<List<Integer>> grid, int capacity) {

int sum = 0;
        for (List<Integer> arr : grid) {
            sum += Math.floor((double) arr.stream().mapToInt(Integer::intValue).sum() / capacity);
        }
        return sum;
    }
}

