class Solution {
    public int xOrY(int n, int x, int y) {
        // Check if n is prime using the Sieve of Eratosthenes
        boolean isPrime = true;
        for (int i = 2; i * i <= n; i++) {
            if (n % i == 0) {
                isPrime = false;
                break;
            }
        }

        // Return x if n is prime, otherwise return y
        if (isPrime) {
            return x;
        } else {
            return y;
        }
    }
}

